using ObjectiveC;using System;using SwiftSharp.Attributes;using System.Collections.Generic;namespace Foundation{	/// <summary>	/// The NSHTTPURLResponse class is a subclass of NSURLResponse that provides methods for accessing information specific to HTTP protocol responses. Whenever you make HTTP URL load requests, any response objects you get back from the NSURLSession, NSURLConnection, or NSURLDownload class are instances of the NSHTTPURLResponse class.	/// </summary>	/// <see cref="https://developer.apple.com/library/prerelease/ios/documentation/Cocoa/Reference/Foundation/Classes/NSHTTPURLResponse_Class/index.html#//apple_ref/occ/cl/NSHTTPURLResponse"/>	[iOSVersion(2)]	public class NSHTTPURLResponse : NSURLResponse//, AnyObject, NSCoding, NSCopying, NSObjectProtocol, NSSecureCoding	{		/// <summary>		/// Initializes an HTTP URL response object with a status code, protocol version, and response headers.		/// </summary>		/// <param name="URL">The URL from which the response was generated.</param>		/// <param name="statusCode">The HTTP status code to return (404, for example). See RFC 2616 for details.</param>		/// <param name="HTTPVersion">The version of the HTTP response as returned by the server. This is typically represented as &quot;HTTP/1.1&quot;.</param>		/// <param name="headerFields">A dictionary representing the keys and values from the server’s response header.</param>		[iOSVersion(5)]		public NSHTTPURLResponse(NSURL URL, int statusCode, string HTTPVersion, Dictionary<NSObject, AnyObject> headerFields) { }				/// <summary>		/// Returns a localized string corresponding to a specified HTTP status code.		/// </summary>		/// <param name="statusCode">The HTTP status code. See RFC 2616 for details.</param>		[iOSVersion(2)]		[Export("localizedStringForStatusCode")]		public static string LocalizedStringForStatusCode(int statusCode) { return default(string); }				/// <summary>		/// All HTTP header fields of the receiver. (read-only)		/// </summary>		[iOSVersion(2)]		[Export("allHeaderFields")]		public Dictionary<NSObject, AnyObject> AllHeaderFields { get; private set; }				/// <summary>		/// The receiver’s HTTP status code. (read-only)		/// </summary>		[iOSVersion(2)]		[Export("statusCode")]		public int StatusCode { get; private set; }	}}